import React from 'react';
import { Outlet, Route, Link } from 'react-router-dom';

import './NavBar.css';

export default function NavBar() {
    return (
        <div>
            <header>
                <div class="container">
                    <a class="logo-text" href="index.html">Arnav Bista</a>
                    <nav>
                        <ul>
                            <li><a>About Me</a></li>
                            <li><a href="#">Portfolio</a></li>
                            <li><a href="#">All Projects</a></li>
                        </ul>
                    </nav>
                </div>
            </header>
            <Outlet />
        </div>
    );
}
